- input: "TEXT\x1CC00009985\x1C29791872\x1C\x1CF3XN\x1CPlease note the receipt from
    Susan Patrick for $1,000 on 3/10/09 was earmarked for WY Values PAC. The earmarked
    disbursement was made on 3/10/09. However, on 3/23/09, NABPAC received an insufficient
    funds notice regarding Ms. Patrick's $1,000 check. NABPAC reports this as a negative
    entry on Schedule A, Line 11ai on this report. Ms. Patrick gave a new credit card
    contribution to NABPAC on 4/10/09, also in the amount of $1,000, to replace the
    insufficient funds check. The earmarked disbursement to WY Values PAC was deposited
    on 3/18/09, before NABPAC received notice that the original receipt had insufficient
    funds. Ms. Patrick's new earmarked receipt will be shown on the May Monthly Report;
    however, the disbursement is reported on this (April Monthly) Report. Please take
    this information into account when reviewing the April and May Monthly Reports.
    Thank you.\n"
